import React from 'react';
import YouTube from 'react-youtube';


const Example = (props) => {
  const opts = {
    height: '390',
    width: '640',
    playerVars: {
      // https://developers.google.com/youtube/player_parameters
      autoplay: 1,
    },
  };
  let ref = React.createRef();
  const callReady = () =>{
      console.log('acho q deu certo');
  }

  function playFullscreen (){
    console.log('acho q deu certo2');
    console.log(ref);
    var requestFullScreen = ref.requestFullScreen || ref.mozRequestFullScreen || ref.webkitRequestFullScreen;
    if (requestFullScreen) {
      requestFullScreen.bind(ref)();
    }
  }

  return (
  <div id="player" onClick={playFullscreen}>
  <YouTube ref={ref} videoId="YjF85_E4p70" opts={opts} onReady={callReady} />;
  </div>);
}

export default Example;
